import './card.css';

export default function Card({id, name, status, species, gender, origin, image, onClose}) {
   return (
      <div className='card-container'>
         <button onClick={onClose}>X</button>
         <div className='image'>
            <img src={image} alt='' />
         </div>
         <div className='details'>
         <h2>{name}</h2>
         <h2>{species}</h2>
         <h2>{gender}</h2>
         <h2>{status}</h2>
         <h2>{origin}</h2>
         </div>
      </div>
   );
}
